import 'dart:math';

import 'package:frontend/models/posts.dart';

class Utils {
  static String removeExceptionPrefix(String errorMessage) {
    if (errorMessage.startsWith('Exception: ')) {
      return errorMessage.substring('Exception: '.length);
    }
    return errorMessage;
  }

  static String getReadableErrorMessage(String error) {
    error = removeExceptionPrefix(error);
    if (error.contains("XMLHttpRequest error")) {
      return "Could not connect to the server";
    } else if (error.contains("SocketException")) {
      return "Network error: Unable to reach the server";
    } else {
      return error;
    }
  }

  static List<Post> generateRandomPosts(int count) {
    final random = Random();
    List<Post> posts = [];

    for (int i = 0; i < count; i++) {
      int postId = i + 1;
      int userId = random.nextInt(100) + 1; // Random user ID between 1 and 100
      String title = 'Post Title $postId';
      String description = 'This is a description for post $postId.';
      String? location =
          (random.nextBool()) ? 'Location ${random.nextInt(50) + 1}' : null;
      int activityTypeId =
          random.nextInt(5) + 1; // Random activity type ID between 1 and 5
      DateTime createdAt =
          DateTime.now().subtract(Duration(days: random.nextInt(30)));
      DateTime expiresAt =
          createdAt.add(Duration(days: random.nextInt(10) + 1));

      // Ensure exactly 3 images per post
      List<PostImage> images = List.generate(
        3, // Always generate 3 images per post
        (index) => PostImage(
          imageId: index + 1,
          postId: postId,
          imageUrl:"",
          uploadedAt:
              DateTime.now().subtract(Duration(days: random.nextInt(10))),
        ),
      );

      posts.add(Post(
        postId: postId,
        userId: userId,
        title: title,
        description: description,
        location: location,
        activityTypeId: activityTypeId,
        createdAt: createdAt,
        expiresAt: expiresAt,
        images: images,
      ));
    }

    return posts;
  }
}
